import styled from "styled-components"

var TodoLiContainer = styled.li`
  background-color: #f0f0f0;
  border-radius: 10px;
  width: 300px;
  list-style: none;
  margin:5px;
  display: flex;
  justify-content: space-around;

`;

var TodoLiElement = styled.div`

`;

function Todo(props){
  return <TodoLiContainer>
    <TodoLiElement>Opgave: {props.Task}</TodoLiElement>
    <TodoLiElement>Frist: {props.Due}</TodoLiElement>
    </TodoLiContainer>
}

export default Todo
